}
@media all and (max-width: 799px) {
   #adngin-right_sidebar-0 { display:none; }
   #adngin-bottom_01-0 { width:320px; }
}
@media screen and (max-height: 500px) {
   #adngin-adhesive-0 { display:none; } /*hide when input*/
}

