function CircNumber(obj,data)
{
	var r = data.radius;
	var n = Math.abs(data.n);
	var d = 2*(r+data.lineWidth+1);
	if( data.lineColor===undefined )
		data.lineColor = "black";
	if( data.fillColor===undefined )
		data.fillColor = "green";
	if( data.lineWidth===undefined )
		data.lineWidth = 2;
	var num = Math.abs(data.num);
	var den = Math.abs(data.den);
	n = Math.floor(n);
	num = Math.floor(num);
	den = Math.floor(den);
	if( data.noLines===undefined ) {
		if( den>15 )
			data.noLines = true;
		else
			data.noLines = false;
	}
	n += Math.floor(num/den);
	num %= den;
	if( data.width===undefined )
		data.width = d*(n+1);
	if( data.height===undefined )
		data.height = 2*(r+data.lineWidth);
	var pi = Math.PI;
	var x = d/2;
	var y = data.height/2;
	var ctx=obj.getContext("2d");
	ctx.canvas.width = data.width;
	ctx.canvas.height = data.height;
	ctx.strokeStyle = data.lineColor;
	ctx.lineWidth = data.lineWidth;
	ctx.lineCap = "round";
	if( n>5 ) return;
	if( n>=1 ) {
		for(var i=0; i<n; i++) {
			ctx.beginPath();
			ctx.arc(x+i*d,y,r,0,2*pi);
			ctx.fillStyle = data.fillColor;
			ctx.fill();
			ctx.stroke();
			ctx.closePath();
		}
	}
	if( den>=2 && num>0 ) {
		x+=n*d;
		var dx,dy;
		var a=-pi/2;
		var da=2*pi/den;
		if( data.noLines==true ) {
			ctx.beginPath();
			dx = r*Math.cos(a);
			dy = r*Math.sin(a);
			da*=num;
			ctx.moveTo(x,y);
			ctx.lineTo(x+dx,y+dy);
			ctx.arc(x,y,r,a,a+da);
			ctx.lineTo(x,y);
			ctx.fillStyle = data.fillColor;
			ctx.fill();
			ctx.arc(x,y,r,a+da,a);
			ctx.stroke();
			ctx.closePath();
		}
		else
		for(var i=0; i<den; i++,a+=da) {
			ctx.beginPath();
			dx = r*Math.cos(a);
			dy = r*Math.sin(a);
			ctx.moveTo(x,y);
			ctx.lineTo(x+dx,y+dy);
			ctx.arc(x,y,r,a,a+da);
			if( i<num ) {
				ctx.fillStyle = data.fillColor;
				ctx.fill();
			}
			ctx.stroke();
			ctx.closePath();
		}
	}
}

